from functools import reduce
class Solution(object):
    def longestDupSubstring(self, S):
        """
        :type S: str
        :rtype: str
        """
        import time
        A = [ord(c) - ord('a') for c in S]
        mod = 2 ** 63 - 1

        def rolling_hash(l, mod, base, s):
            start= reduce(lambda x, y: (x * 26 + y) % mod, A[:l], 0)
            seen = set()
            seen.add(start)
            p = pow(base, l-1, mod)
            for i in range(l, len(s)):
                start = ((start - A[i - l] * p) * base + A[i]) % (mod)
                if start in seen:
                    return i
                seen.add(start)
            return

        if len(S) == 2:
            return S[0] if S[0] == S[1] else ""
        if not rolling_hash(1, mod, 26, S):
            return ""
        res, lo, hi = 0, 0, 50000
        start_time = time.time()
        while lo < hi:

            mi = (lo + hi + 1) // 2
            pos = rolling_hash(mi, mod, 26, S)
            if pos:
                lo = mi
                res = pos
            else:
                hi = mi - 1
            print(mi, time.time() - start_time)
            if time.time() - start_time > 1:
                return

        return S[res - lo + 1:res + 1]


obj = Solution()
obj.longestDupSubstring("")